// Complete the winningLotteryTicket function below.
function winningLotteryTicket(tickets) {
    function addNumberToMap(map, number) {
        let count = 1;
        if (map.has(number))
            count = 1 + map.get(number);

        map.set(number, count);
    }

    const ALL_ONE = parseInt('1111111111', 2), TICKETS_COUNT = tickets.length;
    let number2Count = new Map();
    for (let ticket of tickets) {
        let bits = [], number = 0;
        for (let char of ticket) {
            let num = parseInt(char);
            if (bits[num] === undefined)
                bits[num] = 1;
        }

        for (let i = 0; i < bits.length; i++) {
            if (bits[i] !== undefined)
                number += Math.pow(2, i);
        }

        addNumberToMap(number2Count, number);
    };

    let totalPairs = 0;
    if (number2Count.has(ALL_ONE)) {
        let countOfAll_ONE = number2Count.get(ALL_ONE);
        totalPairs += countOfAll_ONE * (TICKETS_COUNT - 1);
        totalPairs -= (countOfAll_ONE * (countOfAll_ONE - 1)) / 2;
        number2Count.delete(ALL_ONE)
    }

    let allKeyValues = Array.from(number2Count);
    for (let i = 0; i < allKeyValues.length - 1; i++) {
        let numberI = allKeyValues[i][0], countI = allKeyValues[i][1];
        for (let j = i + 1; j < allKeyValues.length; j++) {
            let numberJ = allKeyValues[j][0], countJ = allKeyValues[j][1];
            if ((numberI | numberJ) === ALL_ONE)
                totalPairs += (countI * countJ);
        }
    }

    return totalPairs;
}


function countTime(func) {
    let savedThis = this;
    return function (...args) {
        let start = new Date();
        let result = func.apply(savedThis, args);
        let end = new Date();
        console.log(`${((end - start) / 1000).toFixed(1)} seconds spent.`);
        return result;
    }
}

